import React from 'react';
import ReactDOM from 'react-dom';
import './About.css';
import Home from './Home';
import About from "./About";
import logo from './img/logo.png';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            home: true,
            about: false,
            folio: false
        }
    }

    isHome() {
        if (this.state.home) {
            return "{opacity: 1}";
        }
        return ""
    }

    isAbout(){
        if (this.state.about) {
            return "selected";
        }
        return "unselected";
    }

    isFolio(){
        if (this.state.folio) {
            return "selected";
        }
        return "unselected";
    }

    render() {
        return (
            <div>
                <header>
                        <a id="logo"><img class="clickable" style={this.isHome()} src={logo}/></a>
                        <nav>
                            <a class={this.isAbout() + " clickable"}>About</a>
                            <a class={this.isFolio() + " clickable"}>Portfolio</a>
                        </nav>
                </header>
                <Home />
            </div>
        );
    }
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
